instructions = 'It was an extravagant Halloween Party -- you rented the Red Herring Mansion out on the deserted island, ignoring the mainland villagers\' claims that it was haunted. Your dozens of guests came dressed in an array of costumes and disguises -- a princess, a pirate, devils and goblins and gladiators and such. A grand time was had by all.<br/><br/>At the break of dawn your guests (finally!) took the morning ferry back to the mainland, leaving you alone on the island for the day. You woke up around noon to a violent thunderstorm -- so violent that you find, to your slight panic, that the mansion\'s phone is out. Just the weather, you tell yourself. Surely.<br/><br/>It worsens outside. Thunder and lightning crash around the island and you begin to feel a presence somewhere in the house -- a sinister presence. Perhaps a guest sleeping off one too many in a distant room? No, it feels much less harmless than that. Something -- someone -- who was not invited to the party is here in the mansion with you. And somehow you innately understand that they intend you harm... <br/><br/>Yes, there is somebody close by -- a sinister creature -- and you realize that you must rid yourself of it...before it rids itself of you... <br/><br/>This week\'s contest answer is 1) the identity of your uninvited attendee and 2) the method you used to rid yourself of it.'
explanation = '<MA>1) DRACULA 2) STAKE through the HEART</MA><TEXT>7- and 47-Down tell us to TURN TM / INTO LU. The only instance of TM is in 25-Down, ATM CARD. Turning the TM into LU gives us ALUCARD, which reverses to DRACULA (this upward reversal is hinted at by 1-Across, as well). 27-Down tells us to remove THE MIST to get rid of him. Removing MI from 29-Down gives us STAKE, which crosses THE ARTS at 43-Across which becomes HEART by removing the remaining S and T.</TEXT>'
